Robe Reformation à petits carreaux noirs et blancs, fines bretelles et dos nu. Très bon état, très peu porté. 

Longueur : 67 cm
Largeur bas :55 cm

meraviglioso abito midi vintage Alaïa Paris made in Italy .
Modello fasciante elasticizzato con frangia asimmetrica sull'orlo (tipico motivo dello stilista) e profondo scollo anteriore e posteriore che esalta la femminilità;
composizione tessuto:  85% rayon + 15% elastam con una bella consistenza.
condizioni vintage ottime;
